                    stroke="#10B981" 
                    strokeWidth={2}
                    name="Response Time (ms)"
                  />
                  <Line 
                    yAxisId="right"
                    type="monotone" 
                    dataKey="requestsPerSecond" 
                    stroke="#EF4444" 
                    strokeWidth={2}
                    name="Requests/sec"
                  />
                </LineChart>
              </ResponsiveContainer>
            </div>
          </div>
        )}

                 {/* Performance Trends */}
         <div className="bg-white/10 backdrop-blur-sm rounded-xl p-6 border border-white/20 mb-8">
           <h3 className="text-lg font-bold text-white mb-4">
             {isTestRunning ? 'Live Performance Trends' : 'Performance Trends'}
           </h3>
           <div className="h-64">
             <ResponsiveContainer width="100%" height="100%">
               <LineChart data={
                 isTestRunning && testData.labels.length > 0 
                   ? testData.labels.map((label, index) => ({
                       time: label,
                       responseTime: testData.responseTimes[index] || 0,
                       successRate: testData.successRate[index] || 0
                     }))
                   : performanceTrendsData
               }>
                 <CartesianGrid strokeDasharray="3 3" stroke="#374151" />
                 <XAxis dataKey={isTestRunning ? "time" : "day"} stroke="#9CA3AF" />
                 <YAxis yAxisId="left" stroke="#10B981" />
                 <YAxis yAxisId="right" orientation="right" stroke="#22C55E" />
                 <Tooltip 
                   contentStyle={{ 
                     backgroundColor: '#1F2937', 
                     border: '1px solid #374151',
                     borderRadius: '8px'
                   }}
                 />
                 <Line 
                   yAxisId="left"
                   type="monotone" 
                   dataKey="responseTime" 
                   stroke="#10B981" 
                   strokeWidth={2}
                   name="Response Time (ms)"
                 />
                 <Line 
                   yAxisId="right"
                   type="monotone" 
                   dataKey="successRate" 
                   stroke="#22C55E" 
                   strokeWidth={2}
                   name="Success Rate (%)"
                 />
               </LineChart>
             </ResponsiveContainer>
           </div>
         </div>

        {/* System Health and Recent History */}
        <div className="grid grid-cols-1 lg:grid-cols-2 gap-6">
          {/* System Health Overview */}
          <div className="bg-white/10 backdrop-blur-sm rounded-xl p-6 border border-white/20">
            <h3 className="text-lg font-bold text-white mb-6 text-center">System Health Overview</h3>
            
            <div className="grid grid-cols-1 md:grid-cols-3 gap-6">
              {/* Overall Health */}
              <div className="text-center">
                <div className="relative w-24 h-24 mx-auto mb-2">
                  <ResponsiveContainer width="100%" height="100%">
                    <PieChart>
                      <Pie
                        data={systemHealthData}
                        cx="50%"
                        cy="50%"
                        innerRadius={30}
                        outerRadius={45}
                        paddingAngle={0}
                        dataKey="value"
                      >
                        {systemHealthData.map((entry, index) => (
                          <Cell key={`cell-${index}`} fill={entry.color} />
                        ))}
                      </Pie>
                    </PieChart>
                  </ResponsiveContainer>
                                     <div className="absolute inset-0 flex items-center justify-center">
                     <span className="text-white font-bold">{Math.round(systemHealthData[0].value)}%</span>
                   </div>
                 </div>
                 <div className="text-sm text-gray-400">Overall Health</div>
               </div>

               {/* Performance Score */}
               <div className="text-center">
                 <div className="relative w-24 h-24 mx-auto mb-2">
                   <ResponsiveContainer width="100%" height="100%">
                     <PieChart>
                       <Pie
                         data={performanceScoreData}
                         cx="50%"
                         cy="50%"
                         innerRadius={30}
                         outerRadius={45}
                         paddingAngle={0}
                         dataKey="value"
                       >
                         {performanceScoreData.map((entry, index) => (
                           <Cell key={`cell-${index}`} fill={entry.color} />
                         ))}
                       </Pie>
                     </PieChart>
                   </ResponsiveContainer>
                   <div className="absolute inset-0 flex items-center justify-center">
                     <span className="text-white font-bold">{Math.round(performanceScoreData[0].value)}%</span>
                   </div>
                 </div>
                 <div className="text-sm text-gray-400">Performance Score</div>
               </div>

               {/* Stability Index */}
               <div className="text-center">
                 <div className="relative w-24 h-24 mx-auto mb-2">
                   <ResponsiveContainer width="100%" height="100%">
                     <PieChart>
                       <Pie
                         data={stabilityIndexData}
                         cx="50%"
                         cy="50%"
                         innerRadius={30}
                         outerRadius={45}
                         paddingAngle={0}
                         dataKey="value"
                       >
                         {stabilityIndexData.map((entry, index) => (
                           <Cell key={`cell-${index}`} fill={entry.color} />
                         ))}
                       </Pie>
                     </PieChart>
                   </ResponsiveContainer>
                   <div className="absolute inset-0 flex items-center justify-center">
                     <span className="text-white font-bold">{Math.round(stabilityIndexData[0].value)}%</span>
                   </div>
                 </div>
                 <div className="text-sm text-gray-400">Stability Index</div>
               </div>
            </div>
          </div>

          {/* Recent Test History */}
          <div className="bg-white/10 backdrop-blur-sm rounded-xl p-6 border border-white/20">
            <h3 className="text-lg font-bold text-white mb-6">Recent Test History</h3>
            
            <div className="space-y-4">
              {recentTests.map((test, index) => {
                const IconComponent = test.icon;
                return (
                  <motion.div
                    key={index}
                    initial={{ opacity: 0, x: -20 }}
                    animate={{ opacity: 1, x: 0 }}
                    transition={{ delay: index * 0.1 }}
                    className="flex items-center space-x-3 p-3 bg-white/5 rounded-lg"
                  >
                    <div 
                      className="w-3 h-3 rounded-full"
                      style={{ backgroundColor: getStatusColor(test.status) }}
                    ></div>
                    <div className="flex-1">
                      <div className="font-semibold text-white">{test.type}</div>
                      <div className="text-sm text-gray-300">{test.details}</div>
                      <div className="text-xs text-gray-400">{test.timestamp}</div>
                    </div>
                  </motion.div>
                );
              })}
            </div>
          </div>
        </div>
      </main>
    </div>
  );
};

export default DashboardPage;
